import CardList from "./CardList";
import SearchBox from "./SearchBox";
import { memes } from "./Meme";

const state = {
  memes: memes,
  searchfield: "",
};

class App extends Component {
  render() {
    return (
      <div className="tc">
        <h1>Meme Browser</h1>
        <SearchBox />
        <CardList memes={memes} />
      </div>
    );
  }
}

export default App;
